import {
    IonContent,
    IonInput,
    IonItem,
    IonLabel
} from '@ionic/react';
import React, { useState } from 'react';
import { Header } from '../../components/header';

interface IUser {
    name: string,
    email: string,
    password: string,
    phoneNumber: string
}

export const SignUp = () => {

    const [user, setUser] = useState({} as IUser);

    const setValue = (event: Event) => {
        const target = event.target as HTMLInputElement;
        setUser({
            ...user,
            [target.name]: target.value
        });
    }

    return (
        <>
            <Header
                title={'SignUp'}
                key={'SignUp'}
            />
            <IonContent>
                <IonItem>
                    <IonLabel>Name:</IonLabel>
                    <IonInput name="name" type="text" onIonChange={setValue} />
                </IonItem>
                <IonItem>
                    <IonLabel>Email:</IonLabel>
                    <IonInput name="email" type="email" onIonChange={setValue} />
                </IonItem>
                <IonItem>
                    <IonLabel>Password:</IonLabel>
                    <IonInput name="phoneNumber" type="number" onIonChange={setValue} />
                </IonItem>
                <IonItem>
                    <IonLabel>Title:</IonLabel>
                    <IonInput name="title" type="text" onIonChange={setValue} />
                </IonItem>
            </IonContent>
        </>
    );
}
